pub enum DOMData<E, S, C, L> {
    Void,
    ShadowHost(DOMTree<E, S, C, L>),
    Text(DOMTextNode),
    Normal(DOMNormalNode<E, S, C, L>),
}

pub enum DOMTagName {
    KnownName(KnownElementName),
    Simple(&'static str),
    NamedspacedName(&'static str, &'static str),
}

pub enum DOMAttributeName {
    KnownName(KnownAttributeName),
    EventType(EventType),
    Simple(&'static str),
    NamedspacedName(&'static str, &'static str),
}
